import React from "react";
import { Link } from "react-router-dom";
import { Col } from "react-bootstrap";

class EventCardPlans extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Col md={4}>
        <h3>
          <strong>{this.props.nameEvent}</strong>
        </h3>
        <h4>
          <strong>Ciudad:</strong>
          {this.props.town}
        </h4>
        <h5>
          <strong>Categoria:</strong>
          {this.props.category}
        </h5>
        <h5>
          <strong>Superficie: </strong>
          {this.props.surface} metros cuadrados
        </h5>
        <h6>
          <strong>Aforo:</strong>
          {this.props.capacityPlace} personas
        </h6>
        <p>
          <strong>Descripci√≥n:</strong>
          {this.props.description}
        </p>
        <br></br>

        <Link className="btn btn-sm btn-dark" to={`/eventsDetails`}>
          Ver detalles
        </Link>
      </Col>
    );
  }
}

export default EveEventCardPlansntCard;
